import React from 'react';

const RiskInsurance = () => {
  return (
    <div>
      <h3 className="text-lg font-medium text-gray-900">Risk & Insurance</h3>
      <p className="text-sm text-gray-500 mt-1">Manage company insurance policies and track risk-related documents.</p>
    </div>
  );
};

export default RiskInsurance;
